            {
                "id": "8",
                "type": "predraft",
                "text": "Daniels is the only player in FBS history to pass for 12,000 yards and rush for 3,000 yards. He gets the ball out quickly when he likes the pre-snap look. He gets through his progressions given time and flashes great anticipation throwing over the middle. His completion percentage has steadily improved over the past four seasons, and he's accurate on tape. Daniels also extends plays, and he's one of the most dangerous runners in the class regardless of position. He's quick, has good contact balance and shows pull-away speed. <i>-- Steve Muench</i>"
            },
            {
                "id": "9",
                "type": "postdraft",
                "text": ""
            },
            {
                "id": "10",
                "type": "bottomline",
                "text": "Daniels is an experienced and tested starter who is mentally and physically tough. His quickness and open-field instincts make him an effective runner and scrambler, but he also keeps his eyes downfield as he moves around the pocket and flashes the ability to make off-platform throws. Some teams may view him as a better runner than passer, but he has greatly improved his touchdown-to-interception ratio. Daniels has missed some opportunities to make plays, and he would boost his stock if he can strike a better balance of sound decision-making and increased aggressiveness."
            }
