        "analysis": [
            {
                "id": "10",
                "type": "bottomline",
                "text": "Maye drives the ball into tight spaces with great accuracy when he throws with a strong base and gets the ball out in rhythm. He keeps his eyes downfield while moving around the pocket and makes plays under duress. And he can extend plays, locate receivers late and make off-platform throws. Maye takes unnecessary hits, and he can do a better job of protecting himself by getting down sooner as a runner and throwing the ball away quicker when nothing is available downfield. His footwork is inconsistent, too -- there's too much unnecessary movement, which causes him to miss on occasion."
            },
            {
                "id": "11",
                "type": "video",
                "text": "39811425"
            },
            {
                "id": "8",
                "type": "predraft",
                "text": "Maye extends plays, locates receivers late, adjusts his arm angle when necessary and makes impressive off-platform throws. He's tough and willing to take a hit to make a play, and he routinely makes plays under duress. Maye can thread the needle and lead receivers to yards after the catch when his footwork is sound, and he throws with a strong base from within the pocket. He's a threat to scramble for first downs, too, and pick up yards on designed quarterback runs. <i>-- Steve Muench</i>"
            },
            {
                "id": "9",
                "type": "postdraft",
                "text": ""
            }
        ],
