        "analysis": [
            {
                "id": "11",
                "type": "video",
                "text": "39840733"
            },
            {
                "id": "8",
                "type": "predraft",
                "text": "Latu is an outstanding hand fighter who slips blocks, gets into the backfield and closes well, whether he's rushing the passer or defending the run and regardless of where he lines up. He recorded 34 tackles for loss and 23.5 sacks over the past two seasons. He's an explosive edge rusher with the burst, balance and bend to win with speed off the edge. And Latu can quickly redirect inside after starting upfield. He tracks the quarterback and falls back inside when the QB starts to step up. He has shown great perseverance overcoming a neck injury that forced him to miss two seasons earlier in his college career and led to a transfer to UCLA in 2022. <i>-- Steve Muench</i>"
            },
            {
                "id": "9",
                "type": "postdraft",
                "text": ""
            },
            {
                "id": "10",
                "type": "bottomline",
                "text": "Latu is a talented pass-rusher with a high ceiling. His burst, length and bend -- combined with his ability to swipe hands off his frame and re-direct inside -- make him a threat coming off the edge. He can generate speed to power, and he even flashes as an interior pass-rusher. Latu is a powerful tackler who has good range and closes well, and he is a disruptive run defender with active hands, but he is a better pass-rusher than run defender at this point. He had to transfer schools and come out of a two-year medical retirement to get back on the field in 2022, so the medical will be a big question mark."
            }
        ],
