        "analysis": [
            {
                "id": "11",
                "type": "video",
                "text": "39853727"
            },
            {
                "id": "8",
                "type": "predraft",
                "text": "Fashanu's tape didn't quite meet lofty expectations in 2023, and an injury cut short his workout at the combine, where we expected him to stand out, but he has the tools to develop into an elite pass-blocker. He's quick and long enough to take away the edge from speed rushers. He has the balance and footspeed to mirror and recover when he gets caught out of position, too. Fashanu plays with a wide base and has the core strength to root defenders out in the run game. He also has the range and mobility to develop into an effective zone blocker and downfield blocker. <i>-- Steve Muench</i>"
            },
            {
                "id": "9",
                "type": "postdraft",
                "text": ""
            },
            {
                "id": "10",
                "type": "bottomline",
                "text": "Fashanu has the length, quickness and footspeed to develop into an elite pass-blocker. He shows the ability to take away the edge from speed rushers, step down to take away inside moves and anchor at the top of his set. He also quickly gets into position and is strong enough to move defenders off the ball in the run game. He has the range to develop into an effective zone blocker. But Fashanu is not a technician at this point, and his footwork, hand placement and pad level are inconsistent in both pass pro and the run game."
            }
        ],
