        "analysis": [
            {
                "id": "10",
                "type": "bottomline",
                "text": "Fuaga is an outstanding run blocker with the strength to move defenders off the ball. HeÕs a brawler who blocks to the echo of the whistle and buries defenders. He takes sound angles as a zone blocker and when working up to the second level, and he can knock second-level defenders and edge rushers off course -- and even to the ground. Fuaga is also smooth getting set and uses independent hands to fit up defenders in pass protection. He can power down and counter inside moves when he wins with his hands, and he absorbs power and speed-to-power. Fuaga fights to recover when he gets caught out of position, too."
            },
            {
                "id": "11",
                "type": "video",
                "text": "39840787"
            },
            {
                "id": "8",
                "type": "predraft",
                "text": "Fuaga is an outstanding run-blocker with the strength to move defenders off the ball. He has the initial quickness to reach defenders on zone runs and takes sound angles working up to the second level. He is a brawler who blocks to the echo of the whistle and buries defenders. Fuaga is also smooth getting set, has a powerful punch and uses independent hands in pass protection. One area of concern is his arm length, and defenders had some success getting into his frame on tape, so some NFL teams may view him as a guard. He has the tools and toughness to be a Day 1 starter if he moves inside. <i>-- Steve Muench</i>"
            },
            {
                "id": "9",
                "type": "postdraft",
                "text": ""
            }
        ],
