                "type": "bottomline",
                "text": "Murphy is an outstanding run-defender with a low center of gravity and explosive power. He finds the ball, gets off blocks and pursues with good effort. He gets into gaps and disrupts plays in the backfield, too. Murphy fights to hold his ground when he gets doubled, and he flashes the ability to split double-teams. HeÕs quick with active hands and changes directions well rushing the passer. And Murphy is an effective lead blocker who can even carry the ball and catch the ball on offense in goal-line packages."
