        "analysis": [
            {
                "id": "11",
                "type": "video",
                "text": "39830760"
            },
            {
                "id": "8",
                "type": "predraft",
                "text": "Verse is one of the most talented edge defenders in the 2024 class. The snap in his hips and hands jumps out on tape, and he can transition from speed to power and overwhelm blockers rushing the passer. He has the first step, bend and closing speed to win with speed off the edge. And Verse shoots his hands, engages bigger blockers and gets off blocks defending the run. He has the active hands and footspeed to slip blocks and disrupt plays in the backfield. <i>-- Steve Muench</i>"
            },
            {
                "id": "9",
                "type": "postdraft",
                "text": ""
            },
            {
                "id": "10",
                "type": "bottomline",
                "text": "Yes, his 2022 tape is better than his 2023 tape, but Verse is still one of the most talented edge defenders in the 2024 class. The snap in his hips and hands jumps out on tape, and he can transition from speed to power and overwhelm blockers rushing the passer. He has the first step, bend and closing speed to win with speed off the edge. And Verse shoots his hands, stacks bigger blockers and gets off blocks defending the run. He has active hands and footspeed to slip blocks and disrupt plays in the backfield."
            }
        ],
