                "type": "predraft",
                "text": "DeJean is a playmaker with the instincts, speed and natural hands to make plays in coverage and in the return game. He returned three of his five interceptions for touchdowns in 2022 and took back a punt for a touchdown in 2023. He has the length and burst to smother receivers underneath and recover when he gets caught out of position. DeJean is scheme- and position-versatile; he lined up outside, over the slot and at strong safety at Iowa. <i>-- Steve Muench</i>"
