                "type": "bottomline",
                "text": "Newton is a disruptive run-defender with outstanding instincts and hands. He reads his keys, locates the ball, slips or gets off blocks and wraps up as a tackler. He has the explosive power and a low center of gravity to anchor one-on-one. Newton is also a physical hand fighter who flashes the ability to win clean and is quick to counter when he doesnÕt win with his first move. He changes directions well and makes it tough to square up by working half the man. Plus, he shows the ability to push the pocket."
