        "analysis": [
            {
                "id": "10",
                "type": "bottomline",
                "text": "Barton is a three-year starter at left tackle. He's quick getting set in pass pro and getting into position in the run game. He changes directions well enough to stay in front when his footwork is sound, and his range makes him a good fit for zone-heavy schemes. Barton plays with an edge and blocks to the echo of the whistle. He started five games at center in 2020 and may have to kick inside to succeed in the NFL -- edge defenders have some success getting into his frame and turning the corner. Barton also leans and ends up on the ground too much."
            },
            {
                "id": "8",
                "type": "predraft",
                "text": "Barton started 34 games at left tackle in college and has the traits to quickly develop into a starter at center (where he started five games in 2020) or guard if he kicks inside as is widely expected. He's smooth getting set, changes directions well and flashes the ability to recover when gets caught out of position in pass pro. He has the size and strength to drop an anchor when he wins with his hands, and he explodes off the ball and gets good pop in the run game. Barton overwhelms defenders in space, and his range makes him a good fit for zone-heavy schemes. He plays with an edge and blocks to the echo of the whistle. <i>-- Steve Muench</i>"
            },
            {
                "id": "11",
                "type": "video",
                "text": "39869360"
            }
        ],
