        "analysis": [
            {
                "id": "10",
                "type": "bottomline",
                "text": "Coleman is smooth accelerating off the line, getting out of breaks and making defenders miss whether itÕs after the catch or in the return game. HeÕs a tall target and former basketball player with the catching radius and body control to come down with 50-50 balls. And Coleman led the ACC in touchdown catches and is a tough matchup in the red zone."
            },
            {
                "id": "11",
                "type": "video",
                "text": "39857621"
            },
            {
                "id": "8",
                "type": "predraft",
                "text": "Coleman's 4.61-second combine 40 time is a concern, but he grades out as an early-round pick based on the tape and performed well in other key tests for receivers in Indianapolis. His 10-yard split (1.54 seconds) is quicker than some of the receivers who ran the 40 in the mid-4.4s, and that burst shows up on tape, where he's smooth accelerating off the line and after the catch. Coleman has the size and strength to come down with contested catches and break tackles after the catch. He led the ACC in touchdown catches (11), elevates well and is a tough matchup in the red zone. <i>-- Steve Muench</i>"
            },
            {
                "id": "9",
                "type": "postdraft",
                "text": ""
            }
        ],
