                "text": "Morgan started 37 games at left tackle at Arizona. He has big hands, and he's tough to beat when he gets them inside in pass pro. He has the balance and body control to mirror and recover when he gets caught out of position. And he gets into positon and walls off defenders in the run game. Morgan has short arms for an offensive tackle and may need to move to guard, but he has the frame and skill set to quickly develop into a starter there. <i>-- Steve Muench</i>"
