        "analysis": [
            {
                "id": "11",
                "type": "video",
                "text": "39843872"
            },
            {
                "id": "8",
                "type": "predraft",
                "text": "Nix broke the NCAA single-season record for completion percentage (77.4%) and led the FBS in total touchdowns (45 passing TDs, six rushing TDs) in 2023. He developed into a sound decision-maker over the course of his college career, and he threw just three interceptions in 2023. He gets the ball out quickly and is an effective point guard when he gets a clean pre-snap read. Nix can get through progressions and find the open man given time and space. He extends plays, finds receivers late and makes off-platform throws. And Nix is effective running designed rollouts; he's a threat to scramble for first downs. <i>-- Steve Muench</i>"
            },
            {
                "id": "9",
                "type": "postdraft",
                "text": ""
            },
            {
                "id": "10",
                "type": "bottomline",
                "text": "Nix is a seasoned quarterback who is accurate and effective distributing the ball when he makes sound reads and gets the ball out in time. He plays in an offense that features a lot of horizontal and quick-hitting passes. Nix can press, and there are times he needs to throw the ball away or take the sack."
            }
        ],
