        "analysis": [
            {
                "id": "10",
                "type": "bottomline",
                "text": "Suamataia is smooth getting set and taking the edge away from speed rushers. He flashes a strong punch and is tough to beat when he gets his hands inside. He has the body control and change-of-direction skills to mirror and recover, and he gets into position, gets good initial pop and flashes the ability to drive defenders in the run game. Suamataia has the quickness to scoop backside 3-techniques and 4I-techniques as a zone blocker, too. However, he gives too much ground in pass pro and needs to do a better job of dropping anchor at the top of his set. It's his greatest flaw on tape. He can also over set and lose inside leverage."
            },
            {
                "id": "11",
                "type": "video",
                "text": "39857281"
            },
            {
                "id": "8",
                "type": "predraft",
                "text": "Suamataia's tape is inconsistent, but the flashes and ceiling are impressive. He's quick and long enough to take the edge way from speed rushers. He flashes a powerful punch on tape, and he has big hands, moves well for his size and is tough to beat once he locks on. Suamataia has the size and range to cover up defenders in the run game, too. He can line up on either side and grades out as a No. 3 swing tackle with the potential to develop into a starter early in his career. <i>-- Steve Muench</i>"
            },
            {
                "id": "9",
                "type": "postdraft",
                "text": ""
            }
        ],
