            {
                "id": "8",
                "type": "predraft",
                "text": "Jenkins was a two-year starter and is the son of four-time All-Pro defensive tackle Kris Jenkins. He has the size and strength to set the edge when he lines up on the outside and anchor one-on-one between the tackles. He is long with the upper-body strength to press blockers off his frame and disengage in time to make the play. Jenkins had only four career sacks at Michigan but has the quickness and length to develop into an effective interior pass-rusher at the NFL level. <i>-- Steve Muench</i>"
            }
