                "id": "8",
                "type": "predraft",
                "text": "Bullard is a versatile safety with outstanding closing burst breaking on passes thrown in front of him, and he takes good angles undercutting routes. He's a big hitter with the range and instincts to cover a deep half. He's competitive matching up with slot receivers and tight ends, tracking the ball well with good hand-eye coordination. And Bullard flashes the ability to high-point the ball. He's also an aggressive run-defender who closes well and shows good stopping power. <i>-- Steve Muench</i>"
