                "id": "8",
                "type": "predraft",
                "text": "Kneeland has the long arms to take on blockers and the explosive strength to set the edge when teams run at him. He flashes the ability to slip blocks, chases with good effort, runs well for his size and wraps up. Kneeland is a powerful pass-rusher who shoots his hands and drives blockers. He's more of a threat to get to the quarterback than stats would suggest, and he has good upside. He tested well at the combine, moves well laterally and flashes an effective inside move. <i>-- Steve Muench</i>"
