                "id": "8",
                "type": "predraft",
                "text": "Tampa is a scheme-versatile corner who has longer arms, flashes a strong punch and can make it difficult for receivers to get off the line. He mirrors the receiver's release and smothers them when he's able to stay on top of the route. Tampa is effective at reading receivers in man and recognizing route combinations in zone. He doesn't catch everything he gets his hands on, but he has bigger hands for a corner, played the receiver position in high school and flashes the ability to pluck the ball out of the air. <i>-- Steve Muench</i>"
