                "text": "Colson started 36 games at Michigan and led the team in tackles in each of the past two seasons. He sifts through traffic and flashes the ability to shoot gaps. He has a strong punch and the length to keep blockers off his frame. Colson takes sound angles, chases with good effort and is a reliable tackler. He also gets to depth, reads the quarterback and limits production after the catch in coverage. <i>-- Steve Muench</i>"
