                "type": "predraft",
                "text": "Hicks can line up over the slot and high, but he is at his best playing close to the line of scrimmage. He is effective matching up with backs and tight ends and dropping into underneath zone when he lines up at linebacker depth. Hicks is a rangy run-defender who fills gaps and flashes the ability to disrupt plays in the backfield. He also can pluck the ball out of the air and is competitive in 50-50 situations. <i>-- Steve Muench</i>"
