                "type": "predraft",
                "text": "Corum is a smaller back with average top-end speed, but his tape and production are impressive. He's patient, tough to track behind blockers and accelerates quickly when he gets a crease of space. He's a relentless competitor with a low center of gravity and excellent core strength. Corum keeps his feet going and bounces off defenders trying to bring him down. He led the FBS and set Michigan's single season record with 27 rushing touchdowns in 2023. He's a reliable checkdown option in the pass game who flashes after the catch, and he's competitive in pass protection. <i>-- Steve Muench</i>"
