                "type": "predraft",
                "text": "Hall didn't run at the combine but reportedly had an outstanding pro day workout. He is explosive on tape. He has the active hands to slip blocks and the first-step quickness to get into the backfield. He has the low center of gravity and core strength to anchor one-on-one. Hall had only six sacks over the past two seasons, but he has the traits to get to the quarterback in the NFL. He flashes violent hands, and he changes directions and closes down well. <i>-- Steve Muench</i>"
