                "type": "predraft",
                "text": "Frazier is a four-year starter and three-time team captain who played center and guard at West Virginia. He was a four-time heavyweight wrestling champion in high school, and he's tough to beat once he locks onto defenders with his big hands. He has the quickness to reach and seal defenders on zone runs. Frazier has a nasty disposition and good finishing power. He gets set quickly, has a strong punch and anchors well in pass protection. <i>-- Steve Muench</i>"
