                "id": "8",
                "type": "predraft",
                "text": "Stover played running back in high school and those skills show through after the catch. He's an instinctive open field runner who breaks some tackles and has the ability to make defenders miss. He ran well at the combine and has the speed to make plays down the seam. Stover has good eye-hand coordination and the body control to make tough catches. He works his hands inside and moves his feet as a blocker. Stover played defensive end his freshman year at Ohio State, he played linebacker late in the 2021 season and he has the traits to develop into a core special teams player. <i>-- Steve Muench</i>"
