            {
                "id": "8",
                "type": "predraft",
                "text": "Rice ranked third in the Pac-12 in average yards per catch (17.6) and fourth in the Pac-12 in touchdown catches (12) in 2023. He sticks his foot in the ground and makes crisp breaks at the top of his route. Rice has good size and the ability to separate with strength. He tracks the deep ball well, has enough speed to threaten vertically and the body control to adjust to back-shoulder throws. He has long arms to pluck passes out of the air. <i>-- Steve Muench</i>"
            }
