            {
                "id": "8",
                "type": "predraft",
                "text": "Paul started 44 games at left tackle and has the traits that offensive line coaches covet. He had the second-longest arms at the combine (regardless of position) and his 30 reps of 225 pounds on the bench tied for fourth among offensive linemen who benched. His 10-yard split, 40 time and three-cone time were all good for his size. Paul is smooth getting set and his long arms make it tough for speed rushers to turn the corner. He is quick, has the frame to cover up defenders in the run game and is effective combo blocking to the second level. <i>-- Steve Muench</i>"
            }
