                "text": "Jones started 48 games and lined up at both tackle spots at Texas. He gets good pop when he fires off the ball, and he can generate push in the run game. He fits best in a power-heavy scheme but moves well enough to cover up linebackers at the second level and could develop into an effective zone blocker with improved footwork. Jones is quick enough to handle speed off the edge and has the strength to anchor in pass protection. <i>-- Steve Muench</i>"
