                "text": "Hunt is a versatile defender who plays both off and on the line. He has the first step, length and closing burst to develop into a productive edge rusher early in his NFL career. He flashes as a hand fighter and can push offensive tackles upfield and work inside. Hunt dips his inside shoulder and reduces surface area as a speed rusher. He frequently drops and moves well for his size. And Hunt has the speed and frame to compete with tight ends and backs in coverage. He can slip blocks, make plays in pursuit defending the run and deliver big hits. <i>-- Steve Muench</i>"
