                "type": "predraft",
                "text": "Polk is a natural hands catcher with the radius and strength to reward his quarterback for throwing to him in 50/50 situations. With body control, he can adjust to passes thrown outside his frame and on back-shoulder throws. Polk tracks the ball well and has the speed to challenge vertically. He's tough and can make plays in traffic. He also runs hard and has the balance to break tackles after the catch. <i>-- Steve Muench</i>"
