                "type": "predraft",
                "text": "Oladapo is a versatile safety with good size, long arms and average speed. He can follow and shadow tight ends regardless of where they line up. He tracks the ball well and has the range to cover a deep half. Oladapo also flashes the ability to high point the ball and is competitive at the catch point. He slips blocks and sifts through traffic defending the run, chases with good effort and is a powerful wrap-up tackler. And Oladapo also has active hands and closes well when he blitzes. <i>-- Steve Muench</i>"
