                "text": "Corley led the nation in yards after catch over the past two seasons (1,674), and he's at his best with the ball in his hands. He's explosive, powerful and instinctive, and he can make defenders miss. Defenses have to respect the possibility of him getting the ball when he motions into the backfield. Corley has the speed to threaten vertically when he gets a clean release, too. <i>-- Steve Muench</i>"
