                "type": "predraft",
                "text": "Jackson is a tall press corner with the long arms to get his hands on receivers, break up passes and sweep the feet out from under ball carriers. He can run with most receivers, closes well breaking on passes and has burst blitzing off the edge. He's also an aggressive run-defender who flashes the ability to get off blocks and has good stopping power. And Jackson should make an immediate impact in the NFL covering kicks. <i>-- Steve Muench</i>"
