        "analysis": [
            {
                "id": "8",
                "type": "predraft",
                "text": "Sinnott is versatile player who lines up at tight end, fullback, in the slot and out wide. He's an instinctive open-field runner who breaks some tackles after the catch. He rushed for a touchdown in 2020 and appears capable of developing into an effective short-yardage runner at fullback. He's fast enough to make some plays downfield, too. Sinnott has the frame to box out defenders and provide the quarterback with a big target working against zone looks. He fights the ball at times as a pass-catcher but also shows the ability to pluck it out of the air -- and he doesn't drop many passes. Sinnott also gets into positon and walls off defenders as a lead blocker and in space. <i>-- Steve Muench</i>"
            }
        ],
