                "text": "Rattler was productive despite protection issues and the lack of a consistent ground game in his two seasons at South Carolina. He has the physical traits -- starting with his arm strength and quick release -- to develop into an NFL starter. He can drive the ball downfield and rip passes into tight windows. Rattler did not test well at the combine, but he has the quick feet to escape collapsing pockets and extend plays on tape. <i>-- Steve Muench</i>"
