                "id": "8",
                "type": "predraft",
                "text": "Carter is the first three-time team captain in Duke history. He's a versatile pass-rusher with a quick first step, active hands and good closing speed. His stats dipped in 2023 but he had 10 sacks and forced seven fumbles over the previous two seasons. He reads the quarterback and gets his hands up in passing lanes. Carter also flashes the ability to stack, shed and wrap up defending the run. He's versatile, showing the ability to line up anywhere along the defensive line. <i>-- Steve Muench</i>"
