        "analysis": [
            {
                "id": "8",
                "type": "predraft",
                "text": "Wallace is smooth getting set and times his punch well in pass protection. He started 40 games at right tackle, and that experience shows in his ability to anticipate inside moves and quickly pick up line stunts. He also gets into position, latches on with his big hands and maintains a wide base in the run game. Wallace takes sound angles and has the frame to cover defenders climbing to the second level. <i>-- Steve Muench</i>"
            }
        ],
