                "type": "predraft",
                "text": "Fisher started 26 games at right tackle and one game at left tackle at Notre Dame. He gets a good initial pop and flashes the ability to move defenders off the ball in the run game. He has the length and the change of direction to develop into a reliable pass-blocker at the NFL level. Fisher can give up too much ground initially, but he did a better job of working his hands inside, digging in and recovering last season. <i>-- Steve Muench</i>"
