                "id": "8",
                "type": "predraft",
                "text": "Brade is a versatile safety who is competitive matching up with tight ends lined up in the slot, in line, and out wide. He shows good timing breaking on passes thrown in front of him when lining up deep. He does a good job of sorting out routes and matching up. Brade has big hands and flashes the ability to pluck the ball out of the air. He's an instinctive and tenacious run-defender who led Maryland in tackles each of the past two seasons. <i>-- Steve Muench</i>"
