        "analysis": [
            {
                "id": "8",
                "type": "predraft",
                "text": "Barner is a reliable checkdown with the frame to post up and box out defenders underneath. He has the size and strength to overwhelm defenders as a move-blocker in space. He's a competitive in-line blocker who gets his hands inside and moves his feet. Barner is tough over the middle, runs hard after the catch and blocks to the echo of the whistle. He should compete for early playing time on special teams. <i>-- Steve Muench</i>"
            }
        ],
