        "analysis": [
            {
                "id": "8",
                "type": "predraft",
                "text": "Irving ran for 1,000-plus yards in both seasons at Oregon and led all FBS running backs in catches with 56 in 2023. He's a natural pass-catcher in stride and threatens after the catch. He has the quick feet to sift through traffic in addition to a good burst through the hole and around the corner. Irving makes defenders miss without losing much forward momentum, and he runs well on tape. He's not built like a team's primary ball carrier or power back, but he runs hard and has good contact balance. <i>-- Steve Muench</i>"
            }
        ],
