        "analysis": [
            {
                "id": "8",
                "type": "predraft",
                "text": "Watson's patience, quick feet and burst through the hole makes him an ideal fit for zone schemes. He flashes the ability to make defenders miss in the hole, and he's a shifty open-field runner who makes it tough to get a clean shot on him. He caught 90 passes for 794 yards and five touchdowns over the past two seasons. Watson's a reliable checkdown with the burst to produce after the catch and develop into an effective route runner. <i>-- Steve Muench</i>"
            }
        ],
