                "type": "predraft",
                "text": "Hartman is an effective point guard when he gets the ball out on time and in rhythm. His ability to subtly move around the pocket while keeping his eyes downfield and working through his progressions jumps out on tape. He's a tough competitor who is willing to take a hit to make a play, bounces back from big hits and fights to keep his feet whether he's in the pocket or scrambling. <i>-- Steve Muench</i>"
