                "type": "predraft",
                "text": "McClellan led Alabama in rushing in 2023 and has a chance to be the next Tide running back to make an impact in the NFL. He is a big back who gives his blockers time to get into position before accelerating through the hole. He runs hard and has the contact balance to break some tackles. He's quicker than fast and makes defenders miss in tight spaces without losing much forward momentum. McClellan flashes soft hands as a receiver out of the backfield, too. <i>-- Steve Muench</i>"
