                "type": "predraft",
                "text": "Jones is a developmental prospect who started just 12 games at Michigan where he was primarily the team's sixth offensive lineman. He may need to kick inside to guard in the NFL. He has the first-step quickness to get into position and wall off defenders in the run game. Jones plays with an edge and flashes finishing power. He's smooth getting set, anchors well and has the big hands to lock onto defenders in pass pro. <i>-- Steve Muench</i>"
