                "text": "Edwards is a patient between-the-tackles runner with the footspeed to make defenders miss in the hole. He has a low center of gravity and good contact balance. He's willing to step up and meet defenders in pass protection. Edwards caught 34 passes over the past two seasons, and he doesn't drop many balls he gets his hands on. He also has experience covering kickoffs. <i>-- Steve Muench</i>"
