            {
                "id": "8",
                "type": "predraft",
                "text": "Castles is a tight end/fullback hybrid. He sorts through traffic, squares up and blocks to whistle when he lines up in the backfield. He walls off defenders when he lines up wide and is competitive in pass pro. Castles wasn't targeted much in 2023, but he has good hand-eye coordination and can pluck passes out of the air. He ran well at his pro day and appears fast enough to make some plays down the seam on tape. <i>-- Steve Muench</i>"
            }
