                "type": "predraft",
                "text": "Stogner is a big target who has developed into a reliable checkdown. He knifes upfield and runs hard after the catch. He's not overpowering, and his technique is inconsistent. But Stogner's effort is good, and he has the size to cover up defenders as a blocker. He can line up in-line, in the slot and at fullback. <i>-- Steve Muench</i>"
