            {
                "id": "8",
                "type": "predraft",
                "text": "Plumlee is undersized but effective when he gets the ball out in time and is at his best running run-pass options. He extends plays and scrambles for first downs, forcing defenses to respect designed quarterback keepers. Plumlee holds the Ole Miss freshman rushing record with 1,023 yards. He also caught 19 passes for 201 yards as a receiver at Ole Miss in 2021. <i>-- Steve Muench</i>"
            }
